import React from "react";

function Footer() {
  return (
    <footer>
      <div className="container">
        <div className="footer-update"></div>
        <div className="footer-link"></div>
        <div className="footer-blog"></div>
        <div className="footer-contact"></div>
      </div>
    </footer>
  );
}

export default Footer;
